import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import ExerciseList from "./component/ExerciseList";
import EditExercise from "./component/EditExercise";
import CreateExercise from "./component/CreateExercise";
import CreateUser from "./component/CreateUser";
import NavbarArea from "./component/NavbarArea";

// eslint-disable-next-line
import Footer from "./component/Footer";
// import MiddleTop from "./component/MiddleTop";
// import Features from "./component/Features";
// import Feedback from "./component/Feedback";
// import About from "./component/About";
import Webpage from "./component/Webpage";
import books from "./component/books";
import BooksCategory from "./component/BooksCategory";
import AdminDashboard from "./component/AdminDashboard";


function App() {
  return (
      <div className="container-fluid constainer-class">
      <Router>
      <Route path="/AdminDashboard" component={AdminDashboard} />
      <NavbarArea />
        <Route path="/"  exact component={Webpage} />
        <Route path="/EditExercise/:id" component={EditExercise} />
        <Route path="/books/:name" component={books} />
        <Route path="/CreateExercise" component={CreateExercise} />
        <Route path="/CreateUser" component={CreateUser} />
        <Route path="/BooksCategory" component={BooksCategory} />
        <Footer /> 

      </Router>
      {/* <Webpage /> */}
      {/* <MiddleTop />
      <Features />
      <About />
      <Feedback />*/}
    </div>

  );
}

export default App;
